import styles from './ButtonFilter.module.css';

function ButtonFilter({ isSun }) {
    return (
        <div
            className={
                isSun
                    ? styles.filterContainer
                    : `${styles.filterContainer} darkTheme`
            }
        >
            <button>All</button>
            <button>Active</button>
            <button>Completed</button>
        </div>
    );
}

export default ButtonFilter;
